  PRIMARY KEY (`id`) USING BTREE,
  INDEX `tasks_project_id_block_id_department_id_index`(`project_id`) USING BTREE,
  INDEX `index_block_id`(`block_id`) USING BTREE,
  INDEX `index_department_id`(`department_id`) USING BTREE,
  INDEX `index_dri`(`dri_resource`) USING BTREE,
  INDEX `index_created_user`(`user_create`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2963 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

